import React, {
  Component,
  Fragment
} from 'react';

class Part extends Component {
  render() {
    return(
      <div></div>
    );
  }
}

class App extends Component {
  render() {
    return(
      <Fragment>
        <Part />
      </Fragment>
    );
  }
}

export default App;
